};

var updateMatrix = function(mat) {
    var arr = [];
    var m = mat.length;
    var n = mat[0].length;
    var res = Array(m).fill(0).map(() => Array(n));
    var mark = function(i, j, distance) {
        if (mat[i] === undefined || mat[i][j] === undefined) return;
        if (res[i][j] !== undefined) return;
        arr.push([i, j]);
        res[i][j] = distance;
    };
    for (var i = 0; i < m; i++) {
        for (var j = 0; j < n; j++) {
            mat[i][j] === 0 && mark(i, j, 0);
        }
    }
    while (arr.length) {
        var [i, j] = arr.shift();
        mark(i - 1, j, res[i][j] + 1);
        mark(i + 1, j, res[i][j] + 1);
        mark(i, j - 1, res[i][j] + 1);
        mark(i, j + 1, res[i][j] + 1);
    }
    return res;
};

var findCircleNum = function(M) {
  var count = 0;
  var n = M.length;
  var map = Array(n);

  for (var i = 0; i < n; i++) {
    if (!map[i]) {
      find(map, i, M);
      count++;
    }
  }

  return count;
};

var find = function (map, i, M) {
  for (var j = 0; j < M.length; j++) {
    if (i !== j && M[i][j] === 1 && !map[j]) {
      map[j] = 1;
      find(map, j, M);
    }
  }
};

var nextGreaterElement = function(n) {
    var nums = n.toString().split('');
    var i = nums.length - 1;
    while (i > 0 && nums[i] <= nums[i - 1]) i--;
    if (i === 0) return -1;
    var j = i;
    while (j <= nums.length - 1 && nums[j] > nums[i - 1]) j++;
    swap(nums, i - 1, j - 1);
    var newNums = nums.slice(0, i).concat(nums.slice(i).reverse());
    var newNum = Number(newNums.join(''));
    return newNum > Math.pow(2, 31) - 1 ? -1 : newNum;
};

var swap = function(nums, i, j) {
    var tmp = nums[i];
    nums[i] = nums[j];
    nums[j] = tmp;
};

var reverseWords = function(s) {
  return s.split(' ').map(reverse).join(' ');
};

var reverse = function (word) {
  var len = word.length;
  var res = '';
  for (var i = 0; i < len; i++) {
    res += word[len - i - 1];
  }
  return res;
};

var subarraySum = function(nums, k) {
  var map = {};
  var len = nums.length;
  var sum = 0;
  var res = 0;

  map[0] = 1;

  for (var i = 0; i < len; i++) {
    sum += nums[i];
    res += (map[sum - k] || 0);
    map[sum] = (map[sum] || 0) + 1;
  }

  return res;
};

var matrixReshape = function(nums, r, c) {
  var m = nums.length;
  var n = nums[0].length;

  if (m * n !== r * c) return nums;

  var res = Array(r).fill(0).map(_ => Array(c));
  var num = r * c;

  for (var i = 0; i < num; i++) {
    res[Math.floor(i / c)][i % c] = nums[Math.floor(i / n)][i % n];
  }

  return res;
};

var findPaths = function(m, n, maxMove, startRow, startColumn) {
    var matrix = Array(m).fill(0).map(() => Array(n).fill(0));
    matrix[startRow][startColumn] = 1;
    var res = 0;
    var mod = Math.pow(10, 9) + 7;
    for (var k = 0; k < maxMove; k++) {
        var newMatrix = Array(m).fill(0).map(() => Array(n).fill(0));
        for (var i = 0; i < m; i++) {
            for (var j = 0; j < n; j++) {
                newMatrix[i][j] = (
                    (matrix[i - 1] ? matrix[i - 1][j] : 0) +
                    (matrix[i][j - 1] || 0) +
                    (matrix[i + 1] ? matrix[i + 1][j] : 0) +
                    (matrix[i][j + 1] || 0)
                ) % mod;
                if (i === 0) res += matrix[i][j];
                if (i === m - 1) res += matrix[i][j];
                if (j === 0) res += matrix[i][j];
                if (j === n - 1) res += matrix[i][j];
                res %= mod;
            }
        }
        matrix = newMatrix;
    }
    return res;
};

var tree2str = function(root) {
    if (!root) return '';
    var res = `${root.val}`;
    if (root.left || root.right) res += `(${tree2str(root.left)})`;
    if (root.right) res += `(${tree2str(root.right)})`;
    return res;
};

var mergeTrees = function(t1, t2) {
  if (!t1 && !t2) return null;
  var root = new TreeNode((t1 ? t1.val : 0) + (t2 ? t2.val : 0));
  root.left = mergeTrees(t1 ? t1.left : null, t2 ? t2.left : null);
  root.right = mergeTrees(t1 ? t1.right : null, t2 ? t2.right : null);
  return root;

};

var addOneRow = function(root, v, d) {
  var head = new TreeNode(0);
  head.left = root;
  helper(head, v, d, 1);
  return head.left;
};

var helper = function (root, v, d, depth) {
  if (!root) return;
  if (depth === d) {
    insert(root, v, 'left');
    insert(root, v, 'right');
  } else {
    helper(root.left, v, d, depth + 1);
    helper(root.right, v, d, depth + 1);
  }
};

var insert = function (root, val, type) {
  var node = new TreeNode(val);
  node[type] = root[type];
  root[type] = node;
};

var findErrorNums = function(nums) {
    var missing = 0;
    var duplicated = 0;
    for (var i = 0; i < nums.length; i++) {
        if (nums[Math.abs(nums[i]) - 1] < 0) {
            duplicated = Math.abs(nums[i]);
        } else {
            nums[Math.abs(nums[i]) - 1] *= -1;
        }
    }
    for (var i = 0; i < nums.length; i++) {
        if (nums[i] > 0) {
            missing = i + 1;
        }
    }
    return [duplicated, missing];
};

var findLongestChain = function(pairs) {
    pairs.sort((a, b) => a[0] - b[0]);
    var dp = Array(pairs.length);
    for (var i = pairs.length - 1; i >= 0; i--) {
        var j = i + 1;
        while (j < pairs.length && pairs[j][0] <= pairs[i][1]) j++;
        dp[i] = Math.max(
            dp[i + 1] || 0,
            1 + (dp[j] || 0),
        );
    }
    return dp[0];
};

var predictPartyVictory = function(senate) {
    var s1 = [];
    var s2 = [];
    for (var i = 0; i < senate.length; i++) {
        if (senate[i] === 'R') {
            s1.push(i);
        } else {
            s2.push(i);
        }
    }
    while (s1.length && s2.length) {
        if (s1[0] < s2[0]) {
            s1.push(s1.shift() + senate.length);
            s2.shift();
        } else {
            s2.push(s2.shift() + senate.length);
            s1.shift();
        }
    }
    return s1.length ? 'Radiant' : 'Dire';
};

var constructMaximumBinaryTree = function(nums) {
    return solve(nums, 0, nums.length - 1);
};

var solve = function(nums, left, right) {
    var maxI = left;
    for (var i = left + 1; i <= right; i++) {
        if (nums[i] > nums[maxI]) {
            maxI = i;
        }
    }
    return new TreeNode(
        nums[maxI],
        maxI > left ? solve(nums, left, maxI - 1) : null,
        maxI < right ? solve(nums, maxI + 1, right) : null,
    );
};

var imageSmoother = function(img) {
    var res = Array(img.length).fill(0).map(() => Array(img[0].length));
    for (var i = 0; i < img.length; i++) {
        for (var j = 0; j < img[i].length; j++) {
            var count = 1;
            var num = img[i][j];
            if (img[i - 1]) {
                if (img[i - 1][j - 1] !== undefined) {
                    count += 1;
                    num += img[i - 1][j - 1];
                }
                count += 1;
                num += img[i - 1][j];
                if (img[i - 1][j + 1] !== undefined) {
                    count += 1;
                    num += img[i - 1][j + 1];
                }
            }
            if (img[i][j - 1] !== undefined) {
                    count += 1;
                    num += img[i][j - 1];
                }
            if (img[i][j + 1] !== undefined) {
                count += 1;
                num += img[i][j + 1];
            }
            if (img[i + 1]) {
                if (img[i + 1][j - 1] !== undefined) {
                    count += 1;
                    num += img[i + 1][j - 1];
                }
                count += 1;
                num += img[i + 1][j];
                if (img[i + 1][j + 1] !== undefined) {
                    count += 1;
                    num += img[i + 1][j + 1];
                }
            }
            res[i][j] = Math.floor(num / count);
        }
    }
    return res;
};

var trimBST = function(root, L, R) {
  if (!root) return null;
  if (root.val < L) return trimBST(root.right, L, R);
  if (root.val > R) return trimBST(root.left, L, R);
  root.left = trimBST(root.left, L, R);
  root.right = trimBST(root.right, L, R);
  return root;
};

var knightProbability = function(n, k, row, column) {
    var dp = Array(n).fill(0).map(() => Array(n).fill(0).map(() => Array(k + 1)));
    for (var m = 0; m <= k; m++) {
        for (var i = 0; i < n; i++) {
            for (var j = 0; j < n; j++) {
                solve(n, m, i, j, dp);
            }
        }
    }
    return dp[row][column][k];
};

var directions = [
    [-1, -2],
    [-2, -1],
    [-2, 1],
    [-1, 2],
    [1, 2],
    [2, 1],
    [2, -1],
    [1, -2]
];

var solve = function(n, k, row, column, dp) {
    if (k === 0) {
        dp[row][column][k] = 1;
        return;
    }
    dp[row][column][k] = 0;
    for (var i = 0; i < directions.length; i++) {
        var x = row + directions[i][0];
        var y = column + directions[i][1];
        if (x < 0 || x >= n || y < 0 || y >= n) continue;
        dp[row][column][k] += dp[x][y][k - 1] * 0.125;
    }
};

var findShortestSubArray = function(nums) {
    var map = {};
    var degree = 0;
    for (var i = 0; i < nums.length; i++) {
        if (!map[nums[i]]) {
            map[nums[i]] = {
                left: i,
                right: i,
                num: 1,
            };
        } else {
            map[nums[i]].right = i;
            map[nums[i]].num += 1;
        }
        degree = Math.max(degree, map[nums[i]].num);
    }
    var min = Number.MAX_SAFE_INTEGER;
    for (var i = 0; i < nums.length; i++) {
        if (map[nums[i]].num === degree) {
            min = Math.min(map[nums[i]].right - map[nums[i]].left + 1, min);
        }
    }
    return min;
};

var search = function(nums, target) {
    var left = 0;
    var right = nums.length - 1;
    while (left <= right) {
        var mid = left + Math.floor((right - left) / 2);
        if (nums[mid] === target) {
            return mid;
        } else if (nums[mid] > target) {
            right = mid - 1;
        } else {
            left = mid + 1;
        }
    }
    return -1;
};

